import {BrowserRouter as Router, Routes, Route, Link} from 'react-router-dom';

import Home from './components/pages/Home';

function App() {
  return (
    <Router>
      <ul>
        <Link to = '/'>Home</Link>
        <Link>Venda na Next Level</Link>
        <Link>Ofertas do Dia</Link>
        <Link>Celulares</Link>
        <Link>Tv e Vídeo</Link>
        <Link>Informática</Link>
      </ul>

      <Routes>
        <Route exact path='/' element={<Home/>}/>
      </Routes>

    </Router>
  );
}

export default App;
